Want your bedroom to have an airy feel? Start by adding a clean-lined dresser to get your clothes organized (and off the floor)! We recommend a simple silhouette to let the details shine (think two-toned drawers, brass pulls, and colored paint). 

These dressers are the epitome of function AND beauty. Thanks for the inspiration @upcycledbykatie @fwm.designs @a_ @little_wyld @ispydiy @inthesquaredesign @theapplegrovehome @ourhomeharmony
